componentsModule.modules.title={start:function(){let current=componentsModule.modules.title;current.parentElement=document.querySelector("[data-component=title]");current.inputElement=current.parentElement.querySelector("input");current.titleElement=document.querySelector(".mainline-heading");componentsModule.initializeEvent({event:"keydown keyup change",element:current.inputElement,content:function(a){current.titleElement.innerText=a.target.value.trim()}})},resume:function(){let current=componentsModule.modules.title;const b=current.parentElement.getAttribute("data-resume");if(b===""){return true}const a=JSON.parse(b);current.inputElement.value=a.title;triggerEvent(current.inputElement,"change")},validate:function(){const a=componentsModule.modules.title.serialize().title;return(a.length<101&&a.length>0)},serialize:function(){return{title:componentsModule.modules.title.inputElement.value.trim()}}};